import { StyleSheet} from 'react-native';
const deliveryCompStyles = StyleSheet.create({
  text:{
      fontSize:18
  },
  icons:{
    fontSize:35,
    color:'#1e2833',
    textAlign:"center"
  }
});
export {deliveryCompStyles};
